    [],nt"num_tags": 6,nt"name": "record-of-decision-for-the-final-comprehensive-conservation-plan-and-environmental-impact-",nt"isopen":
    false,nt"url": null,nt"notes": "This record of decision (ROD) for the final
    environmental impact statement (EIS) for the Rocky Mountain Arsenal National Wildlife
    Refuge, Colorado provides the basis for management decisions made by the U.S. Fish
    and Wildlife Service (we, Service). The EIS was prepared as part of the development
    of a comprehensive conservation plan (CCP) in compliance with the National Environmental
    Policy Act (NEPA) and relevant planning policies. We propose to finalize, adopt
    and implement the CCP in the next few months to provide guidance on managing the
    refuge for a 15-year period.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
